pragma solidity >=0.4.21 <0.7.0;

contract Counter {   

    uint [220] T1 = [0];
    uint [220] T2 = [0];

    function setup(uint num) public{
        for(uint i = 0;i < num;i++){
            T1[i] = uint(keccak256(abi.encodePacked(block.difficulty,now)));
            T2[i] = uint(keccak256(abi.encodePacked(block.difficulty,now)));
        }
    }

    function AWS(uint index) public view returns (uint){
        uint co = 0;    
        for(uint i = 0 ;i < index; i++){
            if(T1[i] == T2[i]){
                co++;
            }
        }
        return co;
    }


}
